import React from 'react';
import { Box, Button, TextField, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle} from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'
import Link from '../link'

const styles = (theme) => ({
    root : {

    },
    textField : {
        marginBottom : 20
    },
    linkWrapper : {
        display : "flex",
        flexDirection : "row",
    }
})

const Login = ({ classes, open, handleClose }) => {


  return (
    <div>

      <Dialog open={open} onClose={handleClose} fullWidth={true} maxWidth={'sm'} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title">Login</DialogTitle>
        <DialogContent>
          <DialogContentText>

          </DialogContentText>
            <Box className={classes.textField}>
                <TextField 
                    id="email" 
                    label="Email Address"
                    type="email"
                    fullWidth variant="outlined" 
                    />
            </Box>
            <Box className={classes.textField}>
                <TextField 
                    id="password" 
                    label="Password"
                    type="password"
                    fullWidth variant="outlined" 
                />
            </Box>
            <Box className={classes.linkWrapper}>
                <Link href="#">Forgot Password</Link>

            </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Submit
          </Button>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}


Login.propTypes = {
    open : PropTypes.bool,
    handleClose : PropTypes.func,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Login)
